import React from 'react'
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom'
import TodosContainer from '../Todos'
import Navbar from '../NavBar'

export default function App() {
  return (
    <React.Fragment>
      <Navbar />
      <h1>hello there</h1>
      <TodosContainer />
    </React.Fragment>
  )
}
